import antd,{Carousel} from 'antd';
import '../assets/css/Home.css'
class Home extends Component {
    render() {
        return (
            <Carousel autoplay>
                
                    
                <div>
                     <h3>2</h3>
                 </div>
                <div>
                        <h3>3</h3>
                </div>
                 <div>
                        <h3>4</h3>
                </div>
            
            </Carousel>
        );
    }
}

export default Home;
